/**
 * This class provides an interface with Battlelog's language files.
 * 
 * Do note that this class is still very experimental and rough. It's only used
 * to translate a few necessary things at the momment.
 * 
 * @package  BattlelogApi
 * @author   Blake Harley <contact@blakeharley.com>
 * @since    1.3
 * @abstract 
 * @uses     BattlelogContainer
 */
class BattlelogLanguage extends BattlelogContainer
{
	/**
	 * Language file constructor.
	 * 
	 * @since  1.3
	 * @param  BattlelogApi $api
	 * @param  string $lang The language to use (defaults to 'en_US')
	 * @param  bool $load Whether or not to load the data contents right away
	 * @see    BattlelogContainer::__construct()
	 */
	public function __construct($api, $lang = 'en_US', $load = false)
	{
		$this->_addNamedLoader('file', array($lang, $api));
		
		parent::__construct($api, $load);
	}
}

/**
 * Gets a list of the given soldier's awards.
 * 
 * @package BattlelogApi
 * @author  Blake Harley <contact@blakeharley.com>
 * @since   2.0
 * @uses    BattlelogLoader  
 */
class BattlelogLanguageFileLoader extends BattlelogLoader
{
	/**
	 * @see BattlelogLoader::_init()
	 */
	protected function _init()
	{
		// Set the URI
		$this->_uri = 'http://battlelog-cdn.battlefield.com/public/generated/[[ID]]/surfacetranslations.js';
	}
	
	/**
	 * @see BattlelogLoader::getData()
	 */
	public function getData($force)
	{
		// Only fetch the language file if told to do so
		if ($force)
		{
			return parent::getData($force);
		}
		
		return $this->_parse($this->_getDefaultLang());
	}
	
	/**
	 * @see BattlelogLoader::_parse()
	 */
	protected function _parse($data)
	{
		if (!preg_match('/^[^\{]*\{(.*)\}.*$/si', $data, $matches))
		{
			throw new BattlelogException('Invalid language file');
		}
		
		return json_decode('{' . $matches[1]  . '}', true);
	}
	
	/**
	 * To help cut down on remote file access, a copy of the current en_US
	 * language file is here. If you want to use another language file or an
	 * updated version you can replace the following content or specify the
	 * 'force' boolean when loading this class.
	 * The file content has been compressed to cut down on file size.
	 * 
	 * From          http://battlelog-cdn.battlefield.com/public/generated/en_US/surfacetranslations.js
	 * Last Accessed October 27, 2011 at 3:22PM (CDT)
	 * 
	 * @since  2.0
	 * @return string The saved language file
	 */
	protected static function _getDefaultLang()
	{
		return gzuncompress(base64_decode(<<<EOJSON

EOJSON
		));
	}
}